    "locUSA <- character()  \n",
    "locUK <- character()\n",
    "locUnsure <- character()\n",
    "locOther <- character()\n",
    "\n",
    "\n",
    "# Loop through rows\n",
    "\n",
    "  \n",
    "for (i in 1:length(d$Country)) {\n",
    "  # Check country\n",
    "  if (d$Country[i] == \"USA\") {\n",
    "    locUSA <- c(locUSA, d$Location[i])\n",
    "  } else if (d$Country[i] == \"UK\") {\n",
    "    locUK <- c(locUK, d$Location[i])\n",
    "  } else if (d$Country[i] == \"Unsure\") {\n",
    "    locUnsure <- c(locUnsure, d$Location[i])\n",
    "  } else {\n",
    "    locOther <- c(locOther, d$Location[i])\n",
    "  }\n",
    "}\n",
    "\n",
    "\n",
    "\n",
    "  xf <- list()\n",
    "  \n",
    "  ##USA\n",
    "  \n",
    "  for (i in 1:length(dis_train$location)) {\n",
    "    for (j in length(locUSA)) {\n",
    "      xf[[i]] <- which(locUSA[i] == dis_train$location)\n",
    "    \n",
    "    }\n",
    "  }\n",
    "\n",
    "UScombo <- unlist(xf)\n",
    "sort(unique(UScombo))\n",
    "\n",
    "\n",
    "\n",
    "                        \n",
    "## UK\n",
    "for (i in 1:length(dis_train$location)) {\n",
    "  for (j in length(locUK)) {\n",
    "    xf[[i]] <- which(locUK[i] == dis_train$location)\n",
    "    \n",
    "  }\n",
    "}\n",
    "\n",
    "UKcombo <- unlist(xf)\n",
    "sort(unique(UKcombo))\n",
    "unique(dis_train$location[UKcombo])\n",
    "\n",
    "\n",
    "\n",
    "## Unsure\n",
    "\n",
    "for (i in 1:length(dis_train$location)) {\n",
    "    xf[[i]] <- which(locUnsure[i] == dis_train$location)\n",
    "    \n",
    "}\n",
    "\n",
    "Unsure_combo <- unlist(xf)\n",
    "sort(unique(Unsure_combo))\n",
    "unique(dis_train$location[Unsure_combo])\n",
    "\n",
    "\n",
    "## Other\n",
    "for (i in 1:length(dis_train$location)) {\n",
    "  xf[[i]] <- which(locOther[i] == dis_train$location)\n",
    "  \n",
    "}\n",
    "\n",
    "other_combo <- unlist(xf)\n",
    "sort(unique(other_combo))\n",
    "unique(dis_train$location[other_combo])"
   ]
