   "source": [
    "Other <- other_combo \n",
    "Unsure <- Unsure_combo \n",
    "USA <- UScombo \n",
    "UK <- UKcombo\n",
    "\n",
    "dis_train$country<- NA\n",
    "\n",
    "dis_train$country[Other] <- \"Other\"\n",
    "dis_train$country[Unsure] <- \"Unsure\"\n",
    "dis_train$country[USA] <- \"USA\"\n",
    "dis_train$country[UK] <- \"UK\"\n",
    "dis_train$country <- ifelse(is.na(dis_train$country), \"Other\",dis_train$country )\n",
    "\n",
    "\n",
    "dis_train$keyword <- ifelse(dis_train$keyword == unique(dis_train$keyword)[1], \"other\", dis_train$keyword)\n",
    "\n",
    "unique(dis_train$keyword)\n",
    "\n",
    "table(dis_train$keyword, dis_train$target)"
   ]
